        "title": "These Child Stars Had Their First Kiss On Screen As Kids",
        "description": "Child Stars Who Has Very Awkward First Kisses On Screen In a TV Series Or Movie. \nSubscribe: https://goo.gl/Hnoaw3\n-----------------------------------------------------------------------------------------\n\nMemorizing lines is one thingbut many actors do much more than that in the process of making a movie. Some of them have even had their very first kiss while filming! Just take a look at the cast of Stranger Things including Sadie Sink and Caleb McLaughlin whose initial lip lock happened in front of all their friends. Or Millie Bobby Brown who had to pucker up to Finn Wolfhard with her parents standing nearby. Sisters Elle Fanning and Dakota Fanning have a lot in common including the fact that they had this rite of passage happen on a movie set. Most of these celebs never saw the person again but the same can’t be said for Mila Kunis who married the first person she ever locked lips with! Some stars like Ashley Benson and Katie Holmes admit to being nervous beforehand, while others like Selena Gomez know it’s just part of the job. Sometimes, being young can make the process more difficult; just ask Josh Hutcherson who had to stand on something in order to reach his co-star’s lips!\n\nWhat do you think about these stars who had these normally private moments caught on camera? Do you think they should have waited until a special moment or is that just way too overrated? Let us know what you think in the comment section and then click on the subscribe button to get access to all of the latest videos from us here at TheTalko. \n\n-----------------------------------------------------------------------------------------\nOur Social Media:\nFacebook: https://www.facebook.com/TheTalko\nTwitter: https://twitter.com/thetalko\nInstagram: https://instagram.com/the_talko\n\n-----------------------------------------------------------------------------------------\nFor more videos and articles visit:\nhttp://www.thetalko.com/",
